import React from 'react'

const TextInput = () => {
  return (
    <div>
        <input type="text" placeholder="E-mail" />
        <input type="text" placeholder="Password" />
        <input type="text" placeholder="Confirm Password" />
    </div>
  )
}

export default TextInput
